expressions.TITLE:
rule!AS_GSS_UT_displayDynamicLabel(
  bundleKey: "lbl_UpdateWithArgument",
  arguments: proper(
    cons!AS_GSS_ENUM_UPDATE_EVALUATION_ACTION_TEAMS
  )
)

expressions.CONTEXT:
a!localVariables(
  local!allFactors: rule!AS_GSS_QE_getEvaluationCriteria(
    returnType: cons!AS_CO_ENUM_QE_RETURN_TYPE_OBJECT_ARRAY,
    evaluationId: rv!record[recordType!AS_GSS_Evaluation_RECORD.evaluationId]
  ),
  local!evaluationFactors: rule!AS_CO_UT_filterCdtByField(
    cdt: local!allFactors,
    field: "parentCriteriaId",
    value: null
  ),
  local!evaluationSubFactors: rule!AS_CO_UT_filterCdtByField(
    cdt: local!allFactors,
    field: "parentCriteriaId",
    value: local!evaluationFactors.criteriaId
  ),
  {
    activeStep: rule!AS_GSS_BL_returnContinueSetupStepByContext(
      context: cons!AS_GSS_ENUM_UPDATE_EVALUATION_ACTION_TEAMS,
      isWeightedFactorsRequired: rv!record[recordType!AS_GSS_Evaluation_RECORD.isWeightedFactorsRequired]
    ),
    /* List of AS_GSS_EvaluatorTeam */
    evaluatorTeams: rule!AS_GSS_QE_getEvaluatorTeam(
      returnType: cons!AS_CO_ENUM_QE_RETURN_TYPE_OBJECT_ARRAY,
      evaluationId: rv!record[recordType!AS_GSS_Evaluation_RECORD.evaluationId]
    ),
    /* AS_GSS_Evaluation */
    evaluation: rule!AS_GSS_QE_getEvaluation(
      evaluationId: rv!record[recordType!AS_GSS_Evaluation_RECORD.evaluationId],
      returnType: cons!AS_CO_ENUM_QE_RETURN_TYPE_SINGLE_OBJECT
    ),
    /* List of AS_GSS_Criteria */
    evaluationFactors: local!evaluationFactors,
    /* List of AS_GSS_Criteria */
    evaluationSubFactors: local!evaluationSubFactors,
    /* List of AS_GSS_EvaluationVendor */
    userAction: null,
    factorDocumentMappings: rule!AS_GSS_QE_getFactorDocumentMapping(
      documentIds: rule!AS_GSS_QE_getEvaluationDocuments(
        evaluationId: rv!record[recordType!AS_GSS_Evaluation_RECORD.evaluationId],
        returnType: cons!AS_CO_ENUM_QE_RETURN_TYPE_OBJECT_ARRAY
      ).evalDocumentId
    ),
    evaluatorAliases: rule!AS_GSS_QR_getMaskEvaluatorDetails(
      returnType: cons!AS_CO_ENUM_QE_RETURN_TYPE_OBJECT_ARRAY,
      evaluationId: rv!record[recordType!AS_GSS_Evaluation_RECORD.evaluationId]
    )
  }
)
